{
	OsPortClose(iPortNo);
}

int SignPad_Txd(int iPortNo, uchar ucCmdID, uchar *psTxdData, ushort uiDataLen)
{
	uchar szData[LEN_MAX_SIGN_DATA], *pstBuff;
	uchar ucLRC = 0;
	ushort uiLen = 0;
	
	if(uiDataLen > LEN_MAX_SIGN_DATA)
	{
		return -1;
	}

	memset(szData, 0, sizeof(szData));
	uiLen = uiDataLen+2;
	szData[0] = STX;
	szData[1] = uiLen/256;
	szData[2] = uiLen%256;
	szData[3] = ucCmdID;
	if(psTxdData != NULL)
	{
		memcpy(&szData[4], psTxdData, uiDataLen);
	}
	szData[4+uiDataLen] = ETX;

	SignPadCalcLRC(szData+1, (ushort)(uiDataLen+4), &ucLRC);
	szData[5+uiDataLen] = ucLRC;

	uiLen = uiDataLen+6;
	pstBuff = szData;

	PrtDebugInfo(szData, uiLen, 1);

	OsPortSend(iPortNo, szData, uiLen);

	return 0;
}

int SignPad_Rxd(int iPortNo, uchar *psRxdData, uint *uiDataLen, ushort uiTimeOutSec)
{
	uint uiReadCnt, uiLength, icnt;
	int iResult, iKey=0;
	uchar ucLRC;
	int recv;
	ushort usTimout;
	uchar szRecv[LEN_MAX_RECV_DATA+1];	

	uiReadCnt = 0;
	uiLength = 0;
	usTimout = 500;
	memset(szRecv, 0, sizeof(szRecv));
	
	TimerSet(1,uiTimeOutSec*10);

	while( 1 )
	{
		recv = OsPortRecv(iPortNo, szRecv, LEN_MAX_RECV_DATA, 1);

		OsLog(LOG_DEBUG,"Err:******** OsPortRecv(%d): %d********\n", iPortNo, recv);
		if( recv<0 )
		{
			OsLog(LOG_DEBUG,"Err:****** OsPortRecv return <0 ********");
			if( recv==ERR_INVALID_PARAM )
			{
				continue;
			}
				
			return recv;
		}
			
		if (recv>0)
		{
			PrtDebugInfo(szRecv, recv, 0);

			if( szRecv[0]!=STX )
			{
				OsLog(LOG_DEBUG,"Err:******** szRecv[0](%02x):********\n", szRecv[0]);
				OsLog(LOG_DEBUG,"/t/t******** SignPad_Rxd return 3 :%d ********",szRecv[0]);
				return 3;
			}

			uiLength =  szRecv[1]*256 + szRecv[2];

			if( uiLength > LEN_MAX_RECV_DATA)
			{
				OsLog(LOG_DEBUG,"Erro: \t\t OsPortRecv uiLength > %d", LEN_MAX_RECV_DATA);
				OsLog(LOG_DEBUG,"/t/t******** SignPad_Rxd return 4 :%d ********",uiLength);
				return 4;
			}

			//uiReadCnt++;
			uiReadCnt = uiLength+4;
			OsLog(LOG_DEBUG,"/t/t ****** uiReadCnt : %d *******",uiReadCnt);
			break;
		}

		if (TimerCheck(1)==0)
		{
			return 1;
		}
//		if((iKey = GetKey()) == KEYCANCEL)
//		{
//			return 1;
//		}
	}

	//ETX+LRC
	SignPadCalcLRC(szRecv+1, (ushort)(uiLength+2), &ucLRC);

	if( szRecv[uiReadCnt-2] != ETX || szRecv[uiReadCnt-1] != ucLRC)
	{
		OsLog(LOG_DEBUG,"Erro: \t\t ETX+LRC  RETURN 2");
		OsLog(LOG_DEBUG,"Err:szRecv[uiReadCnt-2]:%02x  ||  szRecv[uiReadCnt-1]:%02x",szRecv[uiReadCnt-2],szRecv[uiReadCnt-1]);
		return 2;
	}

	//锟矫碉拷锟斤拷锟�
	memcpy(psRxdData, &szRecv[3], (uiLength-1));
	if( uiDataLen!=NULL )
	{
		*uiDataLen = (uiLength-1);
	}

	return 0;
}

uchar SignPad_GetPin(int iPortNo, int uiTimeOutSec)
{
	int iRet;
	int i;
	uchar sendData[10] = {0};

	sendData[0] = 0x00;
	sendData[1] = 0x28;
	sendData[2] = 0x01;
	iRet = SignPad_Txd(iPortNo, 0x83, sendData, 3);

	OsLog(LOG_DEBUG,"SignPad_Txd return:%d\n",iRet);
	if(iRet != 0)
	{
		OsLog(LOG_DEBUG,"Err:******** SignPad_HandShake \t SignPad_Txd(%d)\n", iRet);
		return 0;
	}

	ulRecvLen = 0;
	memset(glRecvBuff, 0, sizeof(glRecvBuff));
	iRet = SignPad_Rxd(iPortNo, glRecvBuff, &ulRecvLen, uiTimeOutSec);

	OsLog(LOG_DEBUG,"SignPad_Rxd return:%d\n",iRet);

	if(iRet != 0)
	{
		OsLog(LOG_DEBUG,"Err:********  SignPad_HandShake \t SignPad_Rxd (%d)\n", iRet);
		return 0;
	}

	for(i=0; i<ulRecvLen; i++)
	{
		OsLog(LOG_DEBUG,"glRecvBuff:%02x\n", glRecvBuff[i]);
	}

	if(glRecvBuff[0] != SIGNPAD_HANDSHAKE_REP)
	{
		return 0;
	}

	OsLog(LOG_DEBUG,"glRecvBuff:%02x\n",glRecvBuff[1]);
	return glRecvBuff[1];
}

