//閿熸枻鎷烽敓鏂ゆ嫹绛鹃敓鏂ゆ嫹
uchar SignPad_SignStart(int iPortNo, uchar *szSerial, int uiTimeOutSec)
{
	int iRet;
	int fd;
	int iNum;

	ulRecvLen = 0;
	memset(glRecvBuff, 0, sizeof(glRecvBuff));
	
	iRet = SignPad_Txd(iPortNo, SIGNPAD_SIGN_REQ, szSerial, 8);
	if(iRet != 0)
	{
		//LOGI("Err:\t SignPad_SignStart \t SignPad_Txd(%d)\n", iRet);
		return 0;
	}

	iRet = SignPad_Rxd(iPortNo, glRecvBuff, &ulRecvLen, uiTimeOutSec);

	if(iRet != 0)
	{
		//LOGI("Err:\t SignPad_SignStart \t SignPad_Rxd(%d)\n", iRet);
		return 0;
	}

	//LOGI("/t/t******glRecvBuff[0]:%02x*******",glRecvBuff[0]);
	if(glRecvBuff[0] == SIGNPAD_OK_REP)
	{
		iNum = glRecvBuff[1]*256*256 + glRecvBuff[2]*256 + glRecvBuff[3];
		remove(FILE_SIGNATURE);
		fd = open(FILE_SIGNATURE, O_CREAT|O_RDWR,  0777);
		//fd = open(FILE_SIGNATURE, "w+");
		if(fd < 0)
		{
			//LOGI("Err: ********* open file err: %d ******",fd);
			close(fd);
			return 0;
		}
		lseek(fd,0,SEEK_SET);
		iRet = write(fd, glRecvBuff+4, ulRecvLen-4);
		//iRet = fwrite(glRecvBuff+4, sizeof(char),ulRecvLen-4,fd);
		if(iRet < 0)
		{
			close(fd);
			//fclose(fd);
			//LOGI("Err: line 325\t SignPad_SignStart \t write(%d)\n", iRet);
			return 0;
		}
		//LOGI(" \n\n\n\n\nclose file  \n\n\n\n\n");
		close(fd);
	}
	else if(glRecvBuff[0] == SIGNPAD_NOK_REP || glRecvBuff[0] == SIGNPAD_CANCEL_REP)
	{
		close(fd);
		return 0;
	}

	close(fd);
	return 1;
}

//閿熸枻鎷烽敓鏂ゆ嫹绛鹃敓鏂ゆ嫹
uchar SignPad_SignEnd(int iPortNo)
{
	int iRet;

	iRet = SignPad_Txd(iPortNo, SIGNPAD_SIGN_END_REQ, NULL, 0);
	if(iRet != 0)
	{
		return 0;
	}

	ulRecvLen = 0;
	memset(glRecvBuff, 0, sizeof(glRecvBuff));
	iRet = SignPad_Rxd(iPortNo, glRecvBuff, &ulRecvLen, 3);
	if(iRet != 0)
	{
		return 0;
	}

	if(glRecvBuff[0] != SIGNPAD_SIGN_END_REP)
	{
		return 0;
	}

	return 1;
}

// 閿熸枻鎷烽敓鏂ゆ嫹LRC
static void SignPadCalcLRC(uchar *psData, ushort uiLength, uchar *pucInit)
{
	uchar ucInit;

	if ((psData == NULL) || (pucInit == NULL))
	{
		return;
	}

	ucInit = *psData++;
	uiLength--;
	
	while( uiLength>0 )
	{
		ucInit ^= *psData++;
		uiLength--;
	}

	*pucInit = ucInit;
}


